BMW Fルックシフトノブはシフトポジションに連動し、LEDの色が変化するシフトノブです。本体背面側はBMW純正シフトノブと同様に高品質レザー（ブラック）を採用しています。<br><br>純正カプラの配線本数、差し込む向き（裏表）をご確認の上お取り付け下さい。ドアロック後、シフトノブのP（パーキング）位置が点灯したままになりますが純正機能となり異常ではありません。<br><br>※純正シフトのP（パーキング）位置も点灯しています。車両コンピュータがスリープモードになると消灯します。<br><br>適合車種：BMW 6シリーズ（E63/E64 前期）<br><br>車検対応品<br><br>インテリア | シフトノブ<tr><td colspan="2">
